import Link from "next/link";

export default function Home(props) {
  return (
    <ul>
      <li>
        <Link href="/b" as="/a">
          <a>a</a>
        </Link>
        {props.porcodio}
      </li>
      <li>
        <Link href="/a" as="/b">
          <a>b</a>
        </Link>
      </li>
    </ul>
  );

  Home.getInitialProps = ({ query: { porcodio } }) => {
    return {
      porcodio: porcodio,
    };
  };
}
